looker.plugins.visualizations.add({
    id: 'dj_arc_column_chart',
    label: 'Demandjump column chart',
    options: {
        chooseTheme: {
            label: `Choose a theme`,
            order: 1,
            section: `Format`,
            type: `string`, 
            display: `select`,
            values: [
                {"Horizontal": "Horizontal"},
                {"Vertical": "Vertical"},
                {"Custom": "Custom"}
            ],
            default: `Horizontal`,
            hidden: false
        }, 

        title: {
            label: `Title of chart`,
            order: 4,
            section: `Format`,
            type: `string`,
            placeholder: `Enter chart title here`,
            hidden: false
        },

        showTitle: {
            label: `Show title`,
            order: 5,
            section: `Format`,
            type: `boolean`,
            default: true,
            hidden: false
        },

        yTitle: {
            label: `Y axis Label`,
            order: 3,
            section: `Format`,
            type: `string`,
            placeholder: `Enter y axis label`,
            hidden: false
        },

        xTitle: {
            label: `X axis label`,
            order: 2,
            section: `Format`,
            type: `string`,
            placeholder: `Enter x axis label`,
            hidden: false
        },

        customSpacing: {
            order: 8,
            section: `Format`,
            type: `sentence_maker`,
            words: [
                {type: 'separator', text: ' '}
            ],
            hidden: false
        },

        customLabel: {
            order: 9,
            section: `Format`,
            type: `sentence_maker`,
            words: [
                {type: 'separator', text: 'Custom configuration:'}
            ],
            hidden: false
        },
          
        dataLabels: {
            label: `Enable data labels`,
            order: 10,
            section: `Format`,
            type: `boolean`,
            default: false,
            hidden: false
        },

        horizontal: {
            label: `Plot graph horizontally`,
            order: 11,
            section: `Format`,
            type: `boolean`,
            default: true,
            hidden: false
        },

        endingShape: {
            label: `Ending bar shape`,
            order: 12,
            section: `Format`,
            type: `string`,
            display: `select`,
            values: [
                {'Arrow': 'arrow'},
                {'Rounded': 'rounded'},
                {'Flat': 'flat'},
            ],
            default: `rounded`,
            hidden: false
        },

        renderedData: {
            label: `Use rendered data`,
            order: 13,
            section: `Format`,
            type: `boolean`,
            default: true,
            hidden: false
        }


    },
    create: function(element, config) {
        let d3 = d3v5;
        this._custom = `something`;
        element.innerHTML = `
            <style>
            @import url('https://fonts.googleapis.com/css?family=Roboto:300,400,500&display=swap');
            * { font-family: 'Roboto' !important; }
            </style>
            <div class="row">
                <div class="col-md-6">
                    <div class="main-card mb-3 card">
                        <div class="card-body">
                            <div id="chart-apex-column"></div>
                        </div>
                    </div>
                </div>
            </div>
            `;

        this._container = d3.select(element).append('div')
            .attr('class', 'container')
            .style('position', 'absolute')
            .style('top', '0')
            .style('left', '0');
    },
    updateAsync: function(data, element, config, queryResponse, details, doneRendering) {
        let d3 = d3v5; 
        let node = document.getElementById('chart-apex-column');
        while(node.firstChild) node.firstChild.remove();
        console.log('\n\n\n\n\nThese are the settings', this.options);
        console.log('This is the config', config);
        console.log('Queryresponse', queryResponse);
        console.log('Data', data);
        let pivot = false;
        let pivotA = false;
        let pivotB = false;
        let datum = data;
        // datum.forEach(row => {
        //     for(let i = 0; i < row.length; i++) {
        //         if (row[i].value == null) {
        //             let prev = row[i-1].value;
        //             let next = row[i+1].value;
        //             row[i].value = (prev + next) / 2;
        //         }
        //     }
        // });
        // console.log('Mutated data', datum);

        // Pull pivots inot dimension array
        if (queryResponse.fields.pivots.length != 0) {
            pivot = true;
            if (queryResponse.fields.dimension_like.length == 0) {
                pivotA = true;
                queryResponse.fields._dimension_like = queryResponse.fields.dimension_like;
                queryResponse.fields.dimension_like = queryResponse.fields.pivots;
            } 
            else pivotB = true;
        }


        // Configuration settings
        let theme = 'Horizontal';
        if (config.chooseTheme) theme = config.chooseTheme;
        let rendered = true;
        let changed = false;
        let dataLabels = false;
        let horizontal = false;
        let endingShape = 'rounded';
        let title = ' ';
        let showTitle = true;
        let yTitle = ' ';
        let xTitle = ' ';
        
        if (theme == 'Horizontal' || theme == 'Vertical') {
            if (this._custom != 'horizontalOrVertical') {
                this._custom = 'horizontalOrVertical';
                this.options.customSpacing.hidden = true;
                this.options.customLabel.hidden = true;
                this.options.dataLabels.hidden = true;
                this.options.horizontal.hidden = true;
                this.options.endingShape.hidden = true;
                this.options.renderedData.hidden = true;
                changed = true;
            }

            if (theme == 'Horizontal') {
                horizontal = true;
                yTitle = queryResponse.fields.dimension_like[0].label;
            }
            if (theme == 'Vertical') {
                horizontal = false;
                xTitle = queryResponse.fields.dimension_like[0].label;
            }
        }

        if (theme == 'Custom') {
            if (this._custom != 'Custom') {
                this._custom = 'Custom';
                this.options.customSpacing.hidden = false;
                this.options.customLabel.hidden = false;
                this.options.dataLabels.hidden = false;
                this.options.horizontal.hidden = false;
                this.options.endingShape.hidden = false;
                this.options.renderedData.hidden = false;
                changed = true;
            }

            if (config.dataLabels) dataLabels = config.dataLabels;
            if (config.endingShape) endingShape = config.endingShape;
            if (config.horizontal) horizontal = config.horizontal;
            if (config.renderedData) rendered = config.renderedData;
        }

        if (changed) this.trigger('registerOptions', this.options);

        if (config.title != ``) title = config.title;
        if (config.showTitle) showTitle = config.showTitle;
        if (config.yTitle != ``) yTitle = config.yTitle;
        if (config.xTitle != ``) xTitle = config.xTitle;


        


          // Pull in all the data into the xaxis and series

        let format = `category`; // Either datetime or category
        let xaxis = [];
        let seriesData = [];
        let categoryData = [];
        
        if (!pivot) {
            // Series data structure
            for(let i = 0; i < queryResponse.fields.measure_like.length; i++) {
                let name = queryResponse.fields.measure_like[i].label_short;
                let obj = {name: name, className: name.replace(/ /g, `-`), data: [], links: []};
                seriesData.push(obj);
                categoryData.push(obj);
            }

            // Labels
            datum.forEach(row => {
                let nameVal = row[queryResponse.fields.dimension_like[0].name].value;
                let lonks = row[queryResponse.fields.dimension_like[0].name].links;
                if (lonks == null || lonks == undefined) lonks = [];

                if (format == `dateime` && formatDates == true) {
                    let sameMonthChecker = checkIfSameMonth();
                    if (sameMonthChecker) xaxis.push({name: nameVal, links: lonks});
                    else xaxis.push({name: convertDateTime(nameVal), links: lonks});
                } else {
                    xaxis.push({name: nameVal, links: lonks});
                }
            });

            // Series data
            let series = [];
            datum.forEach((row, index) => {
                for(let i = 0; i < queryResponse.fields.measure_like.length; i++) {
                    let value = 0;
                    let lonks = row[queryResponse.fields.measure_like[i].name].links;
                    if (lonks == null || lonks == undefined) lonks = [];
                    if (row[queryResponse.fields.measure_like[i].name].value != null) value = row[queryResponse.fields.measure_like[i].name].value;
                    seriesData[i].data.push(value);
                    seriesData[i].links.push(lonks);
                }
            });

        } else {
            if (pivotA) {
                // Labels
                queryResponse.pivots.forEach(p => {
                    let lonks = [];
                    if (p.metadata[queryResponse.fields.pivots[0].name].links) lonks = p.metadata[queryResponse.fields.pivots[0].name].links;
                    if (p.metadata[queryResponse.fields.pivots[0].name].rendered) {
                        if (p.metadata[queryResponse.fields.pivots[0].name].rendered != null) xaxis.push({name: p.metadata[queryResponse.fields.pivots[0].name].rendered, links: lonks});
                    } 
                    else xaxis.push({name: p.key, links: lonks});
                });
    
                // Series construct > the measure and the pivot for each key including data across all labels for each series(measure)
                let series = [];
                queryResponse.fields.measure_like.forEach((row, index) => {
                    let obData = [];
                    let liData = [];
                    let newSeries = [];

                    for(let i = 0; i < queryResponse.pivots.length; i++) {
                        let keyname = queryResponse.pivots[i].key;
                        let value = 0;

                        liData.push(datum[0][row.name][keyname].links);
                        
                        if (datum[0][row.name][keyname].value != null) value = datum[0][row.name][keyname].value;
                        obData.push(value);
                    }

                    let obj = {
                        name: row.label_short,
                        className: row.label_short.replace(/ /g, `-`),
                        data: obData,
                        links: liData
                    }
                    seriesData.push(obj);
                });
            }

            if (pivotB) {
                // Labels
                datum.forEach(row => {
                    let lonks = row[queryResponse.fields.dimension_like[0].name].links;
                    if (row[queryResponse.fields.dimension_like[0].name].rendered) xaxis.push({name: row[queryResponse.fields.dimension_like[0].name].rendered, links: lonks});
                    else xaxis.push({name: row[queryResponse.fields.dimension_like[0].name].value, links: lonks});
                });

                // Series Object
                for(let i = 0; i < queryResponse.pivots.length; i++) {
                    let name = queryResponse.pivots[i].data[queryResponse.fields.pivots[0].name];
                    let obj = {
                        name: name,
                        className: name.replace(/ /g, `-`),
                        data: [],
                        links: []
                    };
                    seriesData.push(obj);
                }

                // Series data
                datum.forEach(row => { 
                    for(let i = 0; i < queryResponse.pivots.length; i++) seriesData[i].links.push(row[queryResponse.fields.measure_like[0].name][queryResponse.pivots[i].key].links);
                });

                datum.forEach(row => {
                    for(let i = 0; i < queryResponse.pivots.length; i++) {
                        let value = 0;
                        if (row[queryResponse.fields.measure_like[0].name][queryResponse.pivots[i].key].value != null) value = row[queryResponse.fields.measure_like[0].name][queryResponse.pivots[i].key].value;
                        seriesData[i].data.push(value);
                    }
                });
            }
        }
        console.log('These are the xaxis labels', xaxis);
        console.log('Series data', seriesData);


        let height = window.innerHeight - 45;
        // If we want the user to adjust the column width, here's the functionality. It already auto computes based on multiple measures
        let columnWidth = '55';
        if (config.columnWidth) columnWidth = config.columnWidth;
        columnWidth.toString();
        columnWidth = columnWidth + '%';
        let axisNames = [];
        xaxis.forEach(axis => axisNames.push(axis.name));

        // Column
        let columnChartConfiguration = {
            chart: {
                height: height,
                type: 'bar',
            },
            plotOptions: {
                bar: {
                    horizontal: horizontal,
                    endingShape: endingShape, // Arrow, rounded, flat
                    columnWidth: columnWidth,
                },
            },
            dataLabels: {
                enabled: dataLabels
            },
            stroke: {
                show: true,
                width: 2,
                colors: ['transparent']
            },
            series: seriesData,
            title: {
                text: title,
            },
            xaxis: {
                categories: axisNames,
                title: {
                    text: xTitle
                }
            },
            yaxis: {
                title: {
                    text: yTitle
                }
            },
            fill: {
                opacity: 1

            },
            tooltip: {
                y: {
                    formatter: function (val) {
                        return val;
                    }
                }
            },
            legend: {
                position: 'bottom', // front, back, bottom, top
                horizontalAlign: 'center',
            }
        };
        if (showTitle == false) delete columnChartConfiguration[`title`];


        // Apex Charts
        window.Apex = {
            dataLabels: {enabled: false},
            stroke: {width: 2}
        };

        let chart = new ApexCharts(
            document.querySelector("#chart-apex-column"),
            columnChartConfiguration
        );
        // Apex Charts Init
        if (document.getElementById('chart-apex-column')) chart.render();






        /******************************** 
         * Drilldown Menu Configuration
        ********************************/
        d3.select(".container").selectAll("*").remove(); // Clear out the data before we add the vis
            
            // X axis drilldown menu

        let axisElements = document.getElementsByClassName("apexcharts-xaxis-texts-g");
        let elem = axisElements[0].children;
        let ps;
        let nodes = [];
        console.log(`This is axis elements`, axisElements);
        console.log(`Here are the children`, elem);

        xaxis.forEach(link => {
            link.links.push({label: `by Measue Addition Name`, url: `/explore/djdh_amp_web/djdh_page_views?fields=djdh_…ws.page_view_start_date&limit=500&column_limit=50`, type_label: `Drill into this measure`});
        });

        for(let i = 0; i < xaxis.length; i++) {
            ps = elem[i].getBoundingClientRect();
            let node = {
                index: i,
                id: `_${elem[i].id}`,
                originalId: elem[i].id,
                width: ps.width,
                height: ps.height,
                top: ps.top,
                left: ps.left,
                bottom: ps.bottom,
                right: ps.right,
                transform: elem[i].attributes.transform.value,
                xaxis: xaxis[i].name,
                links: xaxis[i].links,
                element: elem[i]
            };
            nodes.push(node);
        }
        // console.log(`These are the xaxis drilldown nodes`, nodes);

        let container = d3.select(`.container`)
            .append(`div`).attr(`class`, `dimensions`)
                .selectAll(`.dimension`).data(nodes);
        let enter = container.enter().append(`span`);
        container.merge(enter)
            .attr(`class`, `dimension`)
            .attr(`id`, d => d.id)
            .style(`width`, d => `${d.height}px`)
            .style(`height`, d => `${d.width}px`)
            .style(`position`, `absolute`)
            .style(`left`, d => `${d.left}px`)
            // .style(`bottom`, d => `${d.bottom}px`)
            .style(`top`, d => `${d.top}px`)
            // .style(`right`, d => `${d.right}px`)
            .style(`background-color`, `transparent`)
            .style(`opacity`, `0`)
            .style(`z-index`, `4`)
            .style(`transform`, `rotate(-45)`)
            // .html(d => d.text)
            .on('click', d => drillDown(d.links, d3.event));





            // Y axis (Series Drilldown)

        // let tooltip = document.getElementsByClassName(`apexcharts-tooltip-series-group active`);
        // console.log(`This is the tooltip values`);
        // let ttSeries = document.getElementsByClassName(`apexcharts-tooltip-title`);
        // let ttName = ttSeries[0].innerHTML;
        
        // seriesData.forEach((row, index) => {
        //     if (row.name == ttName.splice(0, -2)) {
        //         console.log(`Name found`, row.name);

        //     }
        // });
        










        







        function drillDown(links, event) {
            LookerCharts.Utils.openDrillMenu({ 
                links: links,
                event: event
            });
        }


        /**************************** 
         * Functions
        ****************************/
        function convertDateTime(val) {
            let day = val.substr(0, 4);
            let month = val.substr(5, 2);
            let year = val.substr(8, 2);

            if(month == 1) mon = `Jan`;
            if(month == 2) mon = `Feb`;
            if(month == 3) mon = `Mar`;
            if(month == 4) mon = `Apr`;
            if(month == 5) mon = `May`;
            if(month == 6) mon = `Jun`;
            if(month == 7) mon = `Jul`;
            if(month == 8) mon = `Aug`;
            if(month == 9) mon = `Sep`;
            if(month == 10) mon = `Oct`;
            if(month == 11) mon = `Nov`;
            if(month == 12) mon = `Dec`;
            
            let ret = `${day} ${mon}`; // `${day} ${mon} ${year}`
            return ret;
        }

        function checkIfSameMonth() {
            let yes = false;
            let month = ``;
            let prevMonth = ``;
            datum.forEach(row => {
                let val = row[queryResponse.fields.dimension_like[0].name].value;
                month = val.substr(5, 2);

                if (month == prevMonth) yes = true;
                prevMonth = month; 
            });

            return yes;
        }
        /**************** Done! *****************/
        doneRendering(); 
    }
});






































